INSERT INTO `faqs` VALUES
(1,'{\"en\":\"How can I contact Om Sai Construction?\"}','{\"en\":\"<p>You can reach us at our corporate office: Diamond Corner Building, Plot No 3\\/73\\/3\\/B, 3rd Floor, Khajaguda, Hyderabad - 500089, Telangana State, India. For inquiries, you can also email us at <a href=\\\"mailto:office_ho@omsaico.in\\\">office_ho@omsaico.in<\\/a> or call us at <a href=\\\"tel:+917003849758\\\"><span style=\\\"text-decoration: underline;\\\">+91 7003849758<\\/span><\\/a> \\/ <a href=\\\"tel:+919811260847\\\"><span style=\\\"text-decoration: underline;\\\">+91 9811260847<\\/span><\\/a>.<\\/p>\"}','Published',NULL,'2024-02-12 02:46:43','2024-02-12 02:50:53'),
(2,'{\"en\":\"What services does Om Sai Construction provide?\"}','{\"en\":\"<p>Om Sai Construction specializes in delivering complex construction and infrastructure projects. Our services include project management, construction, maintenance, and renewal of residential and commercial buildings.<\\/p>\"}','Published',NULL,'2024-02-12 02:46:57','2024-02-12 02:46:57'),
(3,'{\"en\":\"How can I apply for a job at Om Sai Construction?\"}','{\"en\":\"<p>To explore career opportunities with us, please visit our Careers page on our official website. Browse through current job openings, and follow the application process outlined in each job description. For specific inquiries, you can contact our HR department at <a href=\\\"mailto:careers@omsaico.in\\\">careers@omsaico.in<\\/a>.<\\/p>\"}','Published',NULL,'2024-02-12 02:47:14','2024-02-12 02:51:25'),
(4,'{\"en\":\"Can I submit my project proposal to Om Sai Construction?\"}','{\"en\":\"<p>Om Sai Construction welcomes collaborations and partnerships. For project proposals or business inquiries, please contact our Business Development team at <a href=\\\"mailto:bizdev@omsaico.in\\\">bizdev@omsaico.in<\\/a>.<\\/p>\"}','Published',NULL,'2024-02-12 02:47:28','2024-02-12 02:51:57'),
(5,'{\"en\":\"How does Om Sai Construction ensure quality in its projects?\"}','{\"en\":\"<p>Quality is a cornerstone of our work. We utilize superior materials, cutting-edge machinery, and follow industry best practices to ensure the highest standards in our construction projects. Our commitment to excellence is unwavering.<\\/p>\"}','Published',NULL,'2024-02-12 02:47:43','2024-02-12 02:47:43'),
(6,'{\"en\":\"Does Om Sai Construction have a privacy policy?\"}','{\"en\":\"<p>Yes, we prioritize the protection of user data. Our Privacy Policy outlines how we collect, use, and protect personal information. You can find the details on our official website.<\\/p>\"}','Published',NULL,'2024-02-12 02:47:57','2024-02-12 02:47:57'),
(7,'{\"en\":\"What ongoing projects does Om Sai Construction have?\"}','{\"en\":\"<p>To stay updated on our ongoing projects, please visit our Projects page on our website. We regularly update project details, timelines, and progress.<\\/p>\"}','Published',NULL,'2024-02-12 02:48:13','2024-02-12 02:48:13');
