INSERT INTO `pages` VALUES
(1,'{\"en\":\"Homepage\"}','homepage','Published','{\"type\":\"image\",\"image\":3,\"cta\":\"<h1>Building Dreams, Shaping Futures<\\/h1><p>At Om Sai Construction, we go beyond bricks and mortar. With a legacy of excellence, we craft spaces that inspire, innovate, and stand the test of time. Join us on a journey where every structure tells a story of quality, commitment, and a better tomorrow.<\\/p><p><a href=\\\"\\/contact-us\\\" data-as-button=\\\"true\\\" data-as-button-theme=\\\"primary\\\">Contact Us<\\/a><\\/p>\"}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"image-text\",\"data\":{\"title\":\"About Us\",\"image\":4,\"image_location\":\"left\",\"content\":\"<p>Om Sai Construction, founded in 2010, is a distinguished player in the construction and infrastructure sector. With a dynamic team and a commitment to excellence, we craft spaces that transcend expectations. Our legacy is built on superior quality, unique design, and a passion for shaping a better tomorrow. Welcome to Om Sai Construction, where every project is a testament to our dedication and innovation.<\\/p><p><a href=\\\"\\/about-us\\\" data-as-button=\\\"true\\\" data-as-button-theme=\\\"primary\\\">Read More<\\/a><\\/p>\"}}]},{\"bg_color\":\"Neutral\",\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<div class=\\\"filament-tiptap-grid-builder\\\" data-type=\\\"responsive\\\" data-cols=\\\"2\\\" style=\\\"grid-template-columns: repeat(2, 1fr);\\\" data-stack-at=\\\"md\\\"><div class=\\\"filament-tiptap-grid-builder__column\\\" data-col-span=\\\"1\\\" style=\\\"grid-column: span 1;\\\"><h1>Vision<\\/h1><ul class=\\\"checked-list\\\"><li><p>Be the market leader for residential and commercial needs.<\\/p><\\/li><li><p>Unparalleled in construction, promoting personal pride.<\\/p><\\/li><li><p>Differentiate as the builder of choice for quality and values.<\\/p><\\/li><li><p>Implement the latest technology for a comfortable lifestyle.<\\/p><\\/li><li><p>Contribute to skill development, enhancing work quality.<\\/p><\\/li><\\/ul><\\/div><div class=\\\"filament-tiptap-grid-builder__column\\\" data-col-span=\\\"1\\\" style=\\\"grid-column: span 1;\\\"><h1>Mission<\\/h1><ul class=\\\"checked-list\\\"><li><p>Provide superior services surpassing client expectations.<\\/p><\\/li><li><p>Offer reliable solutions through a dynamic, trained team.<\\/p><\\/li><li><p>Focus on continuous training, fostering personal growth.<\\/p><\\/li><li><p>Pioneer initiatives for unique design and standards.<\\/p><\\/li><li><p>Treat each project responsibly, delivering excellence.<\\/p><\\/li><\\/ul><\\/div><\\/div>\"}}]},{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"cards\",\"data\":{\"title\":\"Our Services\",\"message\":\"Discover Om Sai Construction\'s precision in construction, enduring maintenance, global expansion, and collaborative solutions, redefining excellence in the built environment.\",\"data\":\"\\\\App\\\\Models\\\\Service\",\"count\":\"4\",\"image_location\":null,\"type\":\"icon\",\"items\":[]}}]},{\"bg_color\":\"Sky\",\"combine\":false,\"blocks\":[{\"type\":\"cards\",\"data\":{\"title\":\"Explore Our Construction Triumphs\",\"message\":\"Step into a world of construction excellence. Explore our completed triumphs and ongoing ventures, each a testament to precision and commitment. Welcome to the Om Sai Construction legacy.\",\"data\":\"\\\\App\\\\Models\\\\Project\",\"count\":null,\"image_location\":\"top\",\"type\":\"image\",\"items\":[]}}]},{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"form\",\"data\":{\"title\":\"Get in Touch !\",\"message\":\"Connect with Om Sai Construction for inquiries or collaborations. Let\'s build the future together!\",\"image\":null,\"image_location\":null,\"type\":\"contact_details\",\"content\":null,\"form_name\":\"contact-us\"}}]}]}','full',1,NULL,'2024-02-11 22:51:37','2024-02-12 01:18:31'),
(2,'{\"en\":\"About Us\"}','about-us','Published','{\"type\":\"image\",\"image\":3,\"cta\":null}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<p>At Om Sai Construction, we don&#039;t just build structures; we craft legacies. Established in 2010 by visionaries Mr. Pinku Kumar and Mr. Sankar Ch Das, our journey began in Punjab and expanded rapidly to Uttar Pradesh, Hyderabad, and other major cities. With a mission to surpass client expectations and a commitment to continuous growth, we&#039;ve become a trusted name in the construction and infrastructure sector.<\\/p><h1><strong>MD&#039;s Message<\\/strong><\\/h1><blockquote><p><em>Message from <strong>Mr. Pinku Kumar,<\\/strong> <strong>Managing Director<\\/strong>:<\\/em><\\/p><\\/blockquote><p>In the realm of construction, we strive not only for quality and speed but also for a harmonious blend with nature. With advanced technology at our disposal, Om Sai Construction is dedicated to creating wonders that stand as testaments to India&#039;s prowess in the global market. Together, let&#039;s build a future where innovation meets sustainability.<\\/p><h1><strong>Partnerships &amp; Team<\\/strong><\\/h1><p>Our success is a result of strategic partnerships and a robust team. Om Sai Construction is proud to be a modern enterprise with a leadership team that empowers each member to exceed customer expectations. From VP Projects to our skilled workmen, each member contributes to our journey of excellence.<\\/p><h3><strong>Our Partnerships:<\\/strong><\\/h3><ul class=\\\"checked-list\\\"><li><p>Collaborations with industry leaders.<\\/p><\\/li><li><p>Strategic alliances for innovative solutions.<\\/p><\\/li><\\/ul><h3><strong>Our Team:<\\/strong><\\/h3><ul class=\\\"checked-list\\\"><li><p>VP Projects: 1<\\/p><\\/li><li><p>GM Projects: 2<\\/p><\\/li><li><p>Project Managers: 4<\\/p><\\/li><li><p>Senior Engineers: 10<\\/p><\\/li><li><p>QS &amp; Planning Engineers: 6<\\/p><\\/li><li><p>Site Engineers: 25<\\/p><\\/li><li><p>Supervisors &amp; Others: 40<\\/p><\\/li><li><p>Workman Strength: 2000<\\/p><\\/li><\\/ul><p>Our team&#039;s diverse expertise forms the backbone of Om Sai Construction, ensuring that every project receives the attention to detail it deserves.<\\/p><p>In essence, Om Sai Construction is more than a construction company; it&#039;s a commitment to excellence, sustainability, and building a better society. Join us as we shape the future of construction.<\\/p>\"}}]}]}','default',0,NULL,'2024-02-12 02:23:48','2024-02-12 02:25:39'),
(3,'{\"en\":\"Materials & Machinery\"}','materials-machinery','Published','{\"type\":\"image\",\"image\":4,\"cta\":null}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<p>At Om Sai Construction, we believe that the right combination of materials and cutting-edge machinery is pivotal in delivering construction excellence. Our commitment to quality is reflected in every aspect of our projects, from the raw materials we use to the advanced machinery that facilitates precision and efficiency.<\\/p><p><strong>Materials:<\\/strong><\\/p><ol><li><p><strong>Concrete:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Sourced for strength and durability.<\\/p><\\/li><li><p>Rigorous testing to ensure quality.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Steel:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>High-grade steel for structural integrity.<\\/p><\\/li><li><p>Compliance with industry standards.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Aluminium Formwork:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Innovative and sustainable construction technology.<\\/p><\\/li><li><p>Enhances efficiency and precision.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>MS Channel &amp; Square:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Structural components for stability.<\\/p><\\/li><li><p>Rigorous quality checks.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Cuplock Material:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Versatile and reliable scaffolding system.<\\/p><\\/li><li><p>Ensures safety and ease of construction.<\\/p><\\/li><\\/ul><\\/li><\\/ol><p><strong>Machinery:<\\/strong><\\/p><ol><li><p><strong>Tower Crane (4 nos):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Essential for lifting heavy loads at various heights.<\\/p><\\/li><li><p>Enhances construction efficiency.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>MS Props (2000 nos):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Adjustable support for formwork and falsework.<\\/p><\\/li><li><p>Ensures stability and safety.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Concrete Pump (1 no):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Facilitates the efficient transfer of concrete.<\\/p><\\/li><li><p>Ideal for large and complex projects.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Total Station (2 nos):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Precision instrument for surveying and layout.<\\/p><\\/li><li><p>Ensures accurate measurements.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Steel Cutting &amp; Bending Machine (10 nos):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Streamlines the fabrication process.<\\/p><\\/li><li><p>Ensures precise cutting and bending of steel.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Man Material Hoist (2 nos):<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Vertical transportation of materials.<\\/p><\\/li><li><p>Enhances productivity and safety.<\\/p><\\/li><\\/ul><\\/li><\\/ol><p>Our in-house machinery, coupled with advanced technologies and a team of skilled professionals, positions Om Sai Construction at the forefront of the construction industry. We continually invest in equipment and materials that align with our commitment to delivering sustainable and high-quality projects.<\\/p>\"}}]}]}','default',0,NULL,'2024-02-12 02:31:21','2024-02-12 02:31:21'),
(4,'{\"en\":\"Privacy Policy\"}','privacy-policy','Published','{\"type\":\"image\",\"image\":3,\"cta\":null}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<ol><li><p><strong>Data Collection:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Clearly state what types of personal information may be collected (e.g., names, contact details, etc.) and the purpose of collecting such information.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Information Usage:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Specify how the collected data will be used. For example, it may be used for project updates, newsletters, or communication related to services.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Data Security:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Assure users that their personal information is stored securely and outline the security measures in place to protect against unauthorized access or disclosure.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Third-Party Sharing:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Clarify whether any personal information will be shared with third parties. If so, provide details on the purpose and the types of third parties involved.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Cookies and Tracking:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>If the website uses cookies or tracking technologies, disclose this information and explain how such technologies are utilized.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Opt-Out Options:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Provide users with the option to opt-out of certain data collection or marketing communications.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Policy Updates:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Clearly state that the privacy policy may be updated, and the date of the last update.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>User Rights:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Inform users about their rights regarding their personal information, including the right to access, correct, or delete their data.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Compliance with Laws:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Confirm that the company complies with applicable data protection laws and regulations.<\\/p><\\/li><\\/ul><\\/li><li><p><strong>Contact Information:<\\/strong><\\/p><ul class=\\\"checked-list\\\"><li><p>Provide contact details for users to reach out if they have questions or concerns about privacy practices.<\\/p><\\/li><\\/ul><\\/li><\\/ol>\"}}]}]}','default',0,NULL,'2024-02-12 02:38:31','2024-02-12 02:38:31'),
