INSERT INTO `services` VALUES
(1,'{\"en\":\"Construction Services\"}','construction-services','ri-settings-3-line',3,'Published','{\"en\":\"Precision and innovation in crafting enduring structures\"}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<h1><strong>Precision in Planning<\\/strong><\\/h1><p>At Om Sai Construction, we bring your visions to life through meticulous planning. Our expert team employs cutting-edge technology and innovative methodologies to create detailed blueprints that serve as the foundation for every project. From site analysis to architectural design, we prioritize precision at every step, ensuring a roadmap for success.<\\/p><h1><strong>Excellence in Execution<\\/strong><\\/h1><p>Executing projects with unparalleled precision is at the core of our construction services. Our skilled workforce, equipped with state-of-the-art machinery, transforms blueprints into remarkable structures. With a commitment to quality craftsmanship, safety, and efficiency, we navigate the complexities of construction, delivering projects that exceed expectations and stand as enduring landmarks.<\\/p>\"}}]}]}',NULL,NULL,'2024-02-11 22:36:55','2024-02-11 22:36:55'),
(2,'{\"en\":\"Maintenance & Renewal\"}','maintenance-renewal','ri-arrow-left-right-line',3,'Published','{\"en\":\"Efficiently ensuring longevity and vitality for landmarks\"}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<h1><strong>Sustaining Vitality<\\/strong><\\/h1><p>At Om Sai Construction, we go beyond the initial build. Our Maintenance &amp; Renewal services are dedicated to ensuring the ongoing vitality and longevity of landmarks. With a proactive approach, we implement strategic maintenance plans, addressing wear and tear, and utilizing innovative solutions to keep structures in optimal condition.<\\/p><h1><strong>Enduring Landmarks<\\/strong><\\/h1><p>Our commitment to excellence extends beyond construction completion. We specialize in the meticulous renewal of existing structures, breathing new life into landmarks. Whether it&#039;s preventive maintenance, structural repairs, or aesthetic enhancements, we take pride in preserving the integrity of the built environment for generations to come.<\\/p>\"}}]}]}',NULL,NULL,'2024-02-11 22:40:48','2024-02-11 22:40:48'),
(3,'{\"en\":\"Global Expansion\"}','global-expansion','ri-global-line',5,'Published','{\"en\":\"Extending expertise beyond borders for international construction projects\"}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<h1><strong>Borderless Expertise<\\/strong><\\/h1><p>Om Sai Construction embraces the challenge of Global Expansion, extending our proven expertise beyond borders. With a track record of successful international projects, we bring our commitment to quality, innovation, and sustainable construction practices to diverse global landscapes.<\\/p><h1><strong>Crafting Worldwide Icons<\\/strong><\\/h1><p>Our global endeavors are not just about construction; they are about crafting worldwide icons. From towering skyscrapers to infrastructural masterpieces, we apply our legacy of excellence on a global scale. Om Sai Construction is your trusted partner in building landmarks that transcend geographical boundaries.<\\/p>\"}}]}]}',NULL,NULL,'2024-02-11 22:44:20','2024-02-11 22:44:20'),
(4,'{\"en\":\"Collaborative Solutions\"}','collaborative-solutions','ri-shake-hands-line',6,'Published','{\"en\":\"Tailor-made services, partnering with clients to meet diverse construction needs.\"}','{\"en\":[{\"bg_color\":null,\"combine\":false,\"blocks\":[{\"type\":\"rich-text\",\"data\":{\"content\":\"<h1><strong>Tailor-Made Partnerships<\\/strong><\\/h1><p>Om Sai Construction believes in the power of collaboration. Our Collaborative Solutions approach begins with understanding our clients&#039; unique needs. Through tailor-made partnerships, we work hand-in-hand with clients, integrating their visions into every phase of the construction process.<\\/p><h1><strong>Client-Centric Excellence<\\/strong><\\/h1><p>Our commitment to client-centric excellence sets us apart. From conceptualization to completion, we prioritize open communication, flexibility, and a shared vision. At Om Sai Construction, we don&#039;t just build structures; we build enduring relationships and deliver construction solutions that precisely align with our clients&#039; goals.<\\/p>\"}}]}]}',NULL,NULL,'2024-02-11 22:48:13','2024-02-11 22:54:42');
